/* page for registering for account */

import * as React from 'react';
import FormGroup from '@mui/material/FormGroup';
import FormControlLabel from '@mui/material/FormControlLabel';
import Checkbox from '@mui/material/Checkbox';
import {blue, white, pink, grey} from '@mui/material/colors';



export default function Register() {
    function handleSubmit(e) {
        e.preventDefault();
        window.location.assign("http://localhost:3000/registerConfirm");
    }
    return (

        <body className= "reg"> 

            <h1>Join ABC</h1>
            <form onSubmit={handleSubmit}>
                <div className="input-group">
                <label htmlFor="name">Email</label>
                <input type="email" id="email" />
                </div>
                <div className="input-group">
                <label htmlFor="email">Password</label>
                <input type="text" id="password" />
                </div>
                <div className="input-group">
                <label htmlFor="name">Confirm Password</label>
                <input type="text" id="password" />
                </div>
                <FormGroup>
                    <FormControlLabel control={<Checkbox sx={{color: pink[800],'&.Mui-checked': {color: pink[600],},}}/>} label="Receive Promotions"  />
                </FormGroup>
                <button onClick= "success()" type="submit" className="submit-btn">
                Submit
                </button>
            </form>
        </body>

    )
}
